import React from 'react'
import { GU } from '@1hive/1hive-ui'

function WalletCard({ icon, title, value }) {
  return (
    <div
      css={`
        border: ${0.25 * GU}px solid #b0ece6;
        box-sizing: border-box;
        border-radius: ${2 * GU}px;
        width: 30%;
        height: ${9 * GU}px;
        display: flex;
        align-items: center;
        padding: ${2.8 * GU}px;
      `}
    >
      <div
        css={`
          display: flex;
          justify-content: space-between;
        `}
      >
        <div
          css={`
            height: ${5 * GU}px;
            width: ${5 * GU}px;
            background: linear-gradient(268.53deg, #aaf5d4, #7ce0d6);
            border-radius: 20px;
            display: flex;
            align-items: center;
            justify-content: center;
          `}
        >
          <img src={icon} />
        </div>
        <div css={`
          margin-left: ${2 * GU}px;
        `}
        >
          <span
            css={`
              align-self: center;
            `}
          >
            {title}
          </span>
          <span
            css={`
              align-self: center;
            `}
          >
            {value}
          </span>
        </div>
      </div>
    </div>
  )
}

export default WalletCard
